import React from 'react';
import './DownloadButtons.css';

const DownloadButtons = () => {
  return (
    <div className="download-buttons">
      <a href="https://placeholder.com/trial-download" target="_blank" rel="noopener noreferrer">Start Free Trial</a>
      <a href="https://placeholder.com/view-downloads" target="_blank" rel="noopener noreferrer">View Downloads</a>
    </div>
  );
};

export default DownloadButtons;
